func TestDBCParse(t *testing.T) {
	r := strings.NewReader(DBCContent)
	p := NewParser(r)
	if !p.Parse() {
		t.Error("Parse failed !!!")
	}

	if data, err := json.Marshal(dbcData); err != nil {
		t.Errorf("Parse failed: %v", err.Error())
	} else {
		fmt.Printf("%q\n", data)
	}
}

